<?php $__env->startSection('content'); ?><p>She's an Olympic Gold Medalist in the decathlon. </p>

<p>And Caitlyn Jenner was seen engaged in a different favorite sport on Saturday, when she was spotted playing golf in the Westlake Village area of Los Angeles, California.</p>

<p>The former reality star, 70, dressed in an all-white ensemble for the athletic excursion at the the Westlake Golf Club, which consisted of a wrap miniskirt and a polo shirt. </p>

<p>Golf pro: Caitlyn Jenner was seen engaged in a favorite sport on Saturday, when she was spotted playing golf in the Westlake Village area of Los Angeles</p>

<p>Jenner also wore a wide-brimmed white sunhat along with a neck protector, as well as large reflective sunglasses. </p>

<p>She did not, however, wear a face covering of any sort, in spite of the ongoing pandemic.</p>

<p>Caitlyn also wore matching socks and white sports shoes with black trim. </p>

<p>Look at that swing: The former reality star, 70, dressed in an all-white ensemble for the athletic excursion at the the Westlake Golf Club</p>

<p>No face mask: She wore  a wide-brimmed white sunhat along with a neck protector, as well as large reflective sunglasses, but no face covering of any sort in spite of the ongoing pandemic</p>

<p>The former husband of Kris Jenner topped off her outfit with a silver nameplate necklace.</p>

<p>Last week, Caitlyn chimed in after news broke previously of the impending conclusion to E!'s reality phenomenon Keeping Up With The Kardashians.</p>

<p>The father of Kendall and Kylie Jenner, who herself had been on the show, reflected in an Instagram video and on her new YouTube channel that she is 'sad' to see the show go, a program which covered 'a great time' in her life. </p>

<p>Last week: Caitlyn chimed in after news broke previously of the impending conclusion to E!'s reality phenomenon Keeping Up With The Kardashians</p>

<p>The septuagenarian athlete has appeared in over 150 episodes of the show focusing on his blended family with ex-wife Kris, from 2007 up until their divorce in 2015 and subsequent gender transition. </p>

<p>She went on to star for two seasons on the E! spin-off I Am Cait in 2016. </p>

<p>Caitlyn revealed in an interview with an Australian TV show that she had not been given advance notice that Keeping Up With The Kardashians would be coming to an end after 14 years and 20 seasons.</p>

<p>Reality history: Jenner reflected in an Instagram video and on her new YouTube channel that she is 'sad' to see the show go, a program which covered 'a great time' in her life</p>

<p>She told Australia's The Morning Show that she found out about the end of KUWTK on the news like everyone else.</p>

<p>'Nobody called me, I heard it through the media. Was I surprised? No,' she added.</p>

<p>She then praised her ex-wife Kris Jenner and their family, saying: 'That show, it's probably the greatest reality show in history. There are over 500 episodes over 14 years.'</p>

<p>Caitlyn went on to declare: 'The girls and Kris have have done just an amazing job with the show and keeping it going for this long. But everybody is in a different place now and I think it's time to move on. But what a run.'</p>

